const Image = require('./model/image')

class Db {

    constructor() {
        this.images = [
            {
                name : 'testA',
                // path : 'testA.png',
                state : 0,
                src  : 'data:image/png;base64,',
            },
            {
                name : 'testB',
                // path : 'testB.png',
                state : 0,
                src  : 'data:image/png;base64,',
            },
            {
                name : 'testC',
                // path : 'testC.png',
                state : 0,
                src  : 'data:image/png;base64,',
            }
        ]
    }

    async initDb() {
        await this.cleanDb()
        this.pushImagesToDb()
    }

    async cleanDb() {
        await Image.deleteMany({})
    }

    pushImagesToDb() {
        this.images.forEach(
            (image) => {
                const newImage = new Image(image)
                newImage.save()
            }
        )
    }

    seeDb() {
        this.pushImagesToDb()
    }

}

module.exports = Db